import React, {useEffect} from 'react';
import MainHeader from "../../../layout/components/main-Header/MainHeader";
import {Link} from "react-router-dom";
import * as contactFeature from '../../../../redux/contacts/contacts.slice';
import * as contactActions from '../../../../redux/contacts/contacts.actions';
import {useDispatch, useSelector} from "react-redux";
import {AppDispatch} from "../../../../redux/store";
import LoadingSpinner from "../../../util/components/spinner/LoadingSpinner";
import ErrorMessage from "../../../util/components/error-message/ErrorMessage";

let ContactsAdmin: React.FC = () => {
    const dispatch: AppDispatch = useDispatch();

    // get all contacts data from redux
    let contactState = useSelector((store: contactFeature.RootContactState) => {
        return store[contactFeature.contactsFeatureKey];
    });

    let {loading, contacts, errorMessage} = contactState;

    useEffect(() => {
        dispatch(contactActions.getAllContactsAction());
    }, [])


    const clickDeleteContact = (contactId: string | undefined) => {
        if (contactId) {
            dispatch(contactActions.deleteContactAction(contactId));
        }
    };

    return (
        <>
            <MainHeader heading={'Contact Manager'}/>
            {/* Search Contact Section */}
            <div className="grid">
                <div className="container">
                    <div className="row">
                        <div className="col-sm-6">
                            <form>
                                <div className="row">
                                    <div className="col">
                                        <input type="text" className="form-control" placeholder="Search Contact"/>
                                    </div>
                                    <div className="col">
                                        <input type="submit" value="Search" className="btn btn-outline-dark"/>
                                        <Link to={'/contacts/add'} className="btn btn-success ms-4">
                                            <i className="fa fa-plus-circle"></i> Create New</Link>
                                    </div>
                                </div>
                            </form>
                        </div>
                    </div>
                </div>
            </div>

            {/* Loading LoadingSpinner */}
            {
                loading && contacts.length === 0 &&
                <LoadingSpinner/>
            }

            {/* Error Message */}
            {
                !loading && errorMessage.message && errorMessage.message?.length > 0 &&
                <ErrorMessage message={errorMessage.message}/>
            }

            {/* Cards Section */}
            <div className="container mt-3">
                <div className="row">
                    {
                        contacts.length > 0 && !loading && contacts.map(contact => {
                            return (
                                <div className="col-sm-6" key={contact.id}>
                                    <div className="card mt-3 shadow-lg">
                                        <div className="card-body">
                                            <div className="card my-2">
                                                <div className="card-body">
                                                    <div className="row d-flex align-items-center justify-content-between">
                                                        <div className="col-3">
                                                            <img
                                                                src={contact.imageUrl}
                                                                alt="" className="img-fluid contact-img rounded-circle"/>
                                                        </div>
                                                        <div className="col-7">
                                                            <ul className="list-group">
                                                                <li className="list-group-item list-group-item-action">
                                                                    Name : <span className="fw-bold">{contact.name}</span>
                                                                </li>
                                                                <li className="list-group-item list-group-item-action">
                                                                    Mobile : <span
                                                                    className="fw-bold">{contact.mobile}</span>
                                                                </li>
                                                                <li className="list-group-item list-group-item-action">
                                                                    Email : <span className="fw-bold">{contact.email}</span>
                                                                </li>
                                                            </ul>
                                                        </div>
                                                        <div className="col-1">
                                                            <div className="d-flex flex-column align-items-center">
                                                                <Link to={`/contacts/view/${contact.id}`}
                                                                      className="btn btn-warning my-1">
                                                                    <i className="fa fa-eye"/>
                                                                </Link>
                                                                <Link to={`/contacts/edit/${contact.id}`}
                                                                      className="btn btn-primary my-1">
                                                                    <i className="fa fa-pen"/>
                                                                </Link>
                                                                <button className="btn btn-danger my-1"
                                                                        onClick={() => clickDeleteContact(contact.id)}>
                                                                    <i className="fa fa-trash"/>
                                                                </button>
                                                            </div>
                                                        </div>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            )
                        })
                    }
                </div>
            </div>
        </>
    )
};
export default ContactsAdmin;
